package grail.MVC;

import java.awt.Component;
import java.awt.event.KeyEvent;
import java.awt.event.KeyListener;
import java.awt.event.MouseEvent;
import java.awt.event.MouseListener;

import grail.compositeFigs.Avatars;
import grail.compositeFigs.BridgeSceneFactory;
import grail.compositeFigs.FiveAvatars;
import tags301.Comp301Tags;
import util.annotations.Tags;

@Tags(Comp301Tags.BRIDGE_SCENE_CONTROLLER)

public class BridgeSceneController extends BridgeSceneMouseController implements KeyListener {

	static final int
		ARTHUR_X = 40,
		ARTHUR_Y = 500,
		GALAHAD_X = 40,
		GALAHAD_Y = 660,
		GUARD_X = 500,
		GUARD_Y = 410,
		LANCE_X = 100,
		LANCE_Y = 500,
		ROBIN_X = 100,
		ROBIN_Y = 660;

	Component aMontySceneComponent;
	FiveAvatars aBridgeScene;
	int newX;
	int newY;



	public BridgeSceneController(Component sceneComponent) {
		aMontySceneComponent = sceneComponent;
		aBridgeScene = BridgeSceneFactory.bridgeSceneFactoryMethod();
		//aBridgeScene = bridgeScene;
		aMontySceneComponent.addKeyListener(this);
		aMontySceneComponent.addMouseListener(this);
	}

	@Override
	public void mouseClicked(MouseEvent e) {
		newX = e.getX();
		newY = e.getY();


	}


	public void mousePressed(MouseEvent e) {}


	public void mouseReleased(MouseEvent e) {}


	public void mouseEntered(MouseEvent e) {}


	public void mouseExited(MouseEvent e) {}

	@Override
	public void keyTyped(KeyEvent e) {
		Avatars arthur = aBridgeScene.getArthur();
		Avatars galahad = aBridgeScene.getGalahad();
		Avatars lancelot = aBridgeScene.getLancelot();
		Avatars robin = aBridgeScene.getRobin();
		char keyPressed = e.getKeyChar();
		switch (keyPressed) {
    	case 'a' :
    		arthur.moveAvatarTo(newX, newY);
    		break;
    	case 'g':
    		galahad.moveAvatarTo(newX, newY);
    		break;
    	case 'l' :
    		lancelot.moveAvatarTo(newX, newY);
    		break;
    	case 'r':
    		robin.moveAvatarTo(newX, newY);
    		break;
    	case 'o':
    		arthur.moveAvatarTo(ARTHUR_X, ARTHUR_Y);

    		galahad.moveAvatarTo(GALAHAD_X, GALAHAD_Y);

    		lancelot.moveAvatarTo(LANCE_X, LANCE_Y);

    		robin.moveAvatarTo(ROBIN_X, ROBIN_Y);
		}

	}


	public void keyPressed(KeyEvent e) {}


	public void keyReleased(KeyEvent e) {}


}

